const initialState = {
  yandexDrive:'11',
    delimobil:'22',
    belkaCar:'33',
    youDrive:'44',
    rentmee:'55',
    bibi:'8888'
}

export default function adminReducer(state = initialState, action ) {
  switch (action.type){
    default:
      return state
  }
}
